import React from "react";

function ContactCard() {
  return (
    <div className="contact-card">
      <img src="http://placekitten.com/300/200"> </img>
      <h3>Mr. Boffa </h3>
      <p> I am happy </p>
      <p> Phone: 392042349823</p>
    </div>
  );
}
export default ContactCard;

<img> </img>;
